import React from 'react';
import {getUrl} from "./AppVariables";
class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {userName:"",password:""};

    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
  }
  handleChange(event){
    this.setState({[event.target.name]: event.target.value});
  }
  handleSubmit(event){
    switch (event.target.name) {
      case "login":
          alert(getUrl());
        break;
      case "register":
          alert("kaydola basıldı");
        break;
      default:
    }
    event.preventDefault();
  }
  render(){
    return(
      <form onSubmit={this.handleSubmit}>
      <ul>
        <li>
          <label html="name">Kullanıcı Adı</label>
          <input type="text" name="userName"  onChange={this.handleChange} />
        </li>
        <li>
          <label html="name">Şifre</label>
          <input type="text" name="password"  onChange={this.handleChange} />
        </li>
        <input type="submit" value="Giriş" name="login" onClick={this.handleSubmit} />
        <input type="submit" value="Kaydol" name="register" onClick={this.handleSubmit} />
      </ul>
      </form>
    );
  }
}
export default App;
